import { useState } from "react";

const Home = () => {


    const [name, setName] = useState(name);

    const handleClick = () => {
        setName(name++);
    }

    return ( 
        <div className="home">
            <h2>HomePage</h2>
            <p>{ name }</p>
            <button onClick={handleClick}>Like</button>
        </div>
     );
}
 
export default Home;
